import React from 'react'

class NavBar extends React.Component{
  render(){
    return(
      <ul className="navbar">
        <li className="navbar button"><a href="#">Home</a></li>
        <li className="navbar button"><a href="#">About</a></li>
        <li className="navbar button"><a href="#">FAQ</a></li>
        <li className="navbar button"><a href="#">Contact</a></li>
      </ul>
    )
  }
}

export default NavBar
